import React, { useContext } from 'react'
import { HaikuContext } from './HaikuList'

function Home() {
    const { haikus, setHaiku } = useContext(HaikuContext);
    return (
        <div>
            <h1>Novelly</h1>
        </div>
    )
}
export default Home
